import React from "react";
import mchammer from "../../img/test/mchammer.gif";
import divider from "../../img/test/divider4.gif";
import fire from "../../img/flames.gif";
import selfIcon from "../../img/self_image.png";
import "./Main.css";

const Icon = () => {
  return <img src={selfIcon} alt="icon of myself"></img>;
};

const McHammer = () => {
  return <img src={mchammer} alt="gif of mchammer" className="hammer"></img>;
};

const Main = () => {
  return (
    <div className="container">
      <div className="welcome">
        <h3 className="welcome-moving-msg">
          君はファンキーモンキーベイビー！！イカれてるよ
        </h3>
        <h1 className="welcome-msg">
          20,000 leagues under the sea!
          <br></br>
          <blink>
            <font style={{ color: "#ff0000" }}>A</font>
            <font style={{ color: "#ff5a00" }}>B</font>
            <font style={{ color: "#ffb400" }}>C</font>
            <font style={{ color: "#FFff00" }}> </font>
            <font style={{ color: "#a5ff00" }}>E</font>
          </blink>
        </h1>
        <McHammer />
        <McHammer />
        <McHammer />
      </div>
      <div className="page-header"></div>
    </div>
  );
};

export default Main;
